import React from 'react';
import { Component } from 'react';
import Counter from './counter';

class Counters extends Component{
    state = {
        count : [
            {id : 1, value : 0 },
            {id : 2, value : 0 },
            {id : 3, value : 0 },
            {id : 4, value : 0 },
            {id : 5, value : 0 }
        ]
    }
    render(){
        return(
            <div>
            <Counter key={this.state.count.map( tag => tag.id)}/>
            <Counter/>
            <Counter/>
            <Counter/>
            <Counter/>
            </div>

        );
    }
}

export default Counters;
